import React, { useState } from "react";
import { Link } from "react-router-dom";
import * as Icons from "react-icons/fa";
import "./Navbar.css";
import Dropdown from "../Dropdown/Dropdown";
import img from '../../../Asserts/Logos/building.png';

function Iconnavbar() {
  const [dropdown, setDropdown] = useState(false);
  const navItems = [
    {
      id: 1,
      title: "Home",
      path: "./",
      cName: "nav-item",
      image:img,
    },
    {
      id: 2,
      title: "Services",
      path: "./services",
      cName: "nav-item",
      image:img,
    },
    {
      id: 3,
      title: "Products",
      path: "./products",
      cName: "nav-item",
      image:img,
    },
    {
      id: 4,
      title: "Contact Us",
      path: "./contactus",
      cName: "nav-item",
      image:img,
    },
  ];
  const Listt=navItems.map((item) => {
    if (item.title === "Services") {
      return (
        <li
          key={item.id}
          className={item.cName}
          onMouseEnter={() => setDropdown(true)}
          onMouseLeave={() => setDropdown(false)}
        >
          <Link to={item.path}>{item.title}</Link>
          {dropdown && <Dropdown />}
        </li>
      );
    }
    {/*return (
      <li key={ite.id} className={ite.cName}>
        <img src={ite.image} alt="" style={{ height:'50px',width:'80px'}}/>
       
      </li>
    );*/}
    return (
      <li key={item.id} className={item.cName}>
         <img src={item.image} alt="" style={{ height:'50px',width:'80px'}}/>
      </li>
    );
  })

  return (
    <>
      <nav className="navbar">
      
        <ul className="nav-items">
        {Listt}
        </ul>
      
      </nav>
    </>
  );
}


export default Iconnavbar;
